class Solution:
    def majorityElement(self, nums: List[int]) -> int:

        valuesEvaluated = []
        size = len(nums)
        for x in range(size):
            number = nums[x]
            # print(nums[x])
            
            # print(cantity)
            if number not in valuesEvaluated:
                cantity = nums.count(number)
                if cantity > (size//2):
                    print(number)   
                    return number
            else:
                valuesEvaluated.append(number)

